import React, { useEffect, useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import DocumentoSiriusApi from '../../Api/Services/DocumentoSiriusApi';
import GenericApi from '../../Api/Services/GenericApi';

function ModalListaVersionesGestorRespuestaAdministracion(props) {

    /*const location = useLocation();
    const { from } = location.state;

    let radicado = from.radicado;
    let procesoDisciplinarioId = from.procesoDisciplinarioId;
    let vigencia = from.vigencia;*/

    const [getRolesListModal, setRolesListModal] = useState([]);
    
    useEffect(() => {
        async function fetchData() {
            GenericApi.getAllGeneric('mas-orden-funcionario/historico/'+props.object).then(
                datos_funcionarios => {
                    if (!datos_funcionarios.error) {
                        if (datos_funcionarios["data"] != "") {
                            setRolesListModal(datos_funcionarios["data"]);
                        }
                    }
                    else {
                        setErrorApi(datos_funcionarios.error.toString())
                        window.showModal(1)
                    }
                }
            )

        }
        fetchData();
    }, []);

    const [errorApi, setErrorApi] = useState('');

    return (
        <>
            <div className="modal fade" id="modal-block-popout-versiones-gestor-respuesta-administracion" tabIndex="-1" role="dialog" aria-labelledby="modal-block-popout" aria-hidden="true">
                <div className="modal-dialog modal-xl modal-dialog-popout" role="document">
                    <div className="modal-content">
                        <div className="block block-themed block-transparent mb-0">
                            <div className="block-header bg-primary-dark">
                                <h3 className="block-title">{ 'Prueba' }</h3>
                                <div className="block-options">
                                    <button type="button" className="btn-block-option" data-dismiss="modal" aria-label="Close">
                                        <i className="fa fa-fw fa-times"></i>
                                    </button>
                                </div>
                            </div>
                            <div className="block-content">
                                {/*
                                   getRolesListModal?.fechas?.map((funcionario, i) => {
                                       return (
                                           funcionario
                                       )
                                   })
                                */}
                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="button" className="btn btn-sm btn-primary" data-dismiss="modal">{ 'Cerrar' }</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default ModalListaVersionesGestorRespuestaAdministracion;
